function Navbar({ signup, signin, signoff, toggleSignup, toggleSignin }) {
    return (
        <div>
            <nav className="navbar navbar-expand-lg bg-body-tertiary">
                <div className="container-fluid">
                    <a className="navbar-brand brand fw-bold fs-3" href="#">
                        To-do-LIST
                    </a>
                    {!signin && (
                        <a 
                            className="nav-link active fw-bold fs-5 brand-sub ps-2" 
                            aria-current="page" 
                            href="#"
                            onClick={toggleSignin}
                        >
                            Sign In
                        </a>
                    )}
                    {!signup && (
                        <a 
                            className="nav-link active fw-bold fs-5 brand-sub" 
                            aria-current="page" 
                            href="#"
                            onClick={toggleSignup}
                        >
                            Sign Up
                        </a>
                    )}
                    {signoff && (
                        <a 
                            className="nav-link active fw-bold fs-5" 
                            aria-current="page" 
                            href="#"
                        >
                            Log Out
                        </a>
                    )}
                </div>
            </nav>
        </div>
    );
}

export default Navbar;
